import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Artists from './pages/Artists';
import ArtistDetail from './pages/ArtistDetail'; // Import the ArtistDetail component

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/artists" element={<Artists />} />
        <Route path="/artists/:id" element={<ArtistDetail />} /> // Define the route for individual artist page
      </Routes>
    </Router>
  );
};

export default App;
